import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <li key={item.id}>
    <div>{item.id}</div>
    <div>{item.firstname}</div>
    <div>{item.lastname}</div>
    <div>{item.year}</div>
  </li>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
